import React from 'react'
import App from './App';

class SW extends React.Component {
  constructor(props) {
    super(props);
     this.state = {
       memes: [] 
       ,isFetch: true
   }
 }

  componentDidMount() {
     fetch('https://swapi.dev/api/people/')
      .then(response => response.json())
      .then(starwarsJson => this.setState({ memes: starwarsJson.result, isFetch:false}))
  }

  render() {
    if (this.state.isFetch){
      return 'Loading...'
    }
